import logo from './logo.svg';
import axios from 'axios'
import './App.css';
import {useState, useEffect} from 'react'



const App = () =>{


const [cars, setCars] = useState([])
const [newImage, setNewImage] = useState()
const [newMake, setNewMake] = useState()
const [newModel, setNewModel] = useState()
const [newYear, setNewYear] = useState()
const [newPrice, setNewPrice] = useState()
const [newMileage, setNewMileage] = useState()

  useEffect(()=>{
    axios
        .get("http://localhost:3000/cars")
        .then((response)=>{
          setCars(response.data)
        })
  },[])


// to be able to add add Cars
const handleNewCarFormSubmit = (event)=>{
  event.preventDefault()
  axios.post(
    "http://localhost:3000/cars",
    {
      image: newImage,
      make: newMake,
      model: newModel,
      year: newYear,
      price: newPrice,
      mileage: newMileage

    }
  ).then(()=>{
    axios
        .get("http://localhost:3000/cars")
        .then((response)=>{
          setcars(response.data)
        })
  })
}



return(
  <>
  <h1> Car Dealership Website</h1>

      <form onSubmit={handleNewCarFormSubmit}>
            <h2>Add a New Car</h2>
            Image: <input type="text"></input> <br/>
            Make: <input type="text"></input> <br/>
            Model: <input type="text"></input> <br/>
            Year: <input type="text"></input><br/>
            Price: <input type="text"></input><br/>
            Mileage: <input type="text"></input><br/> <br/>
            <input type="Submit" value="Submit"></input><br/>
      </form> <br/> <br/> <br/>
      <div>
            {
              cars.map((car)=>{
                return(
                  <div>

                      <img class="btn" src={car.image}/> <br/> <br/>

                      <details>
                            <h2>Edit Car Listing</h2>
                            Image: <input type="text"></input> <br/>
                            Make: <input type="text"></input> <br/>
                            Model: <input type="text"></input> <br/>
                            Year: <input type="text"></input><br/>
                            Price: <input type="text"></input><br/>
                            Mileage: <input type="text"></input><br/> <br/>
                            <input type="Submit" value="Submit"></input><br/>
                      </details>

                      <h1>{car.make}</h1>
                      <h2>{car.model}</h2>
                      <h3>year: {car.year}</h3>
                      <h4>Price: ${car.price}</h4>
                      <h5>Mileage: {car.mileage}</h5>
                      <input type="submit" value="Delete" /> <br/> <br/><br/><br/>


                  </div>

                )

              })
            }
      </div>

  </>
)


}
